%jdbc(hive)
/*External table creation*/

create database if not exists nama
  location '/user/nama/hive';

drop table if exists nama.sbb;

create external table if not exists nama.sbb(BETRIEBSTAG string ,FAHRT_BEZEICHNER string, BETREIBER_ID string, BETREIBER_ABK string,BETREIBER_NAME string, PRODUKT_ID string, LINIEN_ID string, LINIEN_TEXT string, UMLAUF_ID string, VERKEHRSMITTEL_TEXT string, ZUSATZFAHRT_TF string, FAELLT_AUS_TF string, BPUIC string, HALTESTELLEN_NAME string, ANKUNFTSZEIT string, AN_PROGNOSE string, AN_PROGNOSE_STATUS string, ABFAHRTSZEIT string, AB_PROGNOSE string, AB_PROGNOSE_STATUS string, DURCHFAHRT_TF string)
    row format delimited fields terminated by ';' 
    stored as textfile 
    location '/datasets/sbb/';

%jdbc(hive)
/*Check if the table has been created*/

select * from nama.sbb limit 200

%jdbc(hive)
/*Check if the date of interested  exist*/


select * from nama.sbb where BETRIEBSTAG == '17.10.2017' limit 5

%jdbc(hive)
/*Create table from external table*/

drop table if exists nama.sbb_17_10_2017;
create table nama.sbb_17_10_2017
stored as parquet
as
select * from nama.sbb where BETRIEBSTAG == '17.10.2017';

%jdbc(hive)
/*Check if the table has been created*/

select * from nama.sbb_17_10_2017 limit 5;

%jdbc(hive)
/*number of stops on 17.10.2017*/
select upper(produkt_id) as type_of_transport,count((HALTESTELLEN_NAME)) as number_of_transport from nama.sbb_17_10_2017 group by upper(produkt_id);

%jdbc(hive)
/*number of stops for each transport types with dates*/
select betriebstag as day, upper(produkt_id) as type_of_transport,count(HALTESTELLEN_NAME) as count_of_transport from nama.sbb where produkt_id <> '' and produkt_id <> 'PRODUKT_ID' group by betriebstag, upper(produkt_id) order by unix_timestamp(betriebstag, 'dd.MM.yyyy');

%jdbc(hive)
/*get the numbers of completed journeys where arrival time of them are empty which means that they indicate full trips.*/
select upper(produkt_id) as type_of_transport,count(produkt_id) as number_of_trips from nama.sbb_17_10_2017 where faellt_aus_tf <> 'true' and ankunftszeit == '' group by upper(produkt_id);

%jdbc(hive)
/*Avarage number of trips per transport for whole dataset.*/
drop table if exists nama.av_nums;

create table if not exists nama.av_nums as
select upper(produkt_id) as type_of_transport, count(produkt_id) / count(DISTINCT betriebstag) as avarage_number_of_trips from nama.sbb where produkt_id <> '' and produkt_id <> 'PRODUKT_ID' and faellt_aus_tf <> 'true' and ankunftszeit == '' group by upper(produkt_id);

select * from nama.av_nums

%jdbc(hive)
/*get the numbers of completed journeys with dates where arrivals time of them are empty which means that they indicate full trips.The results are ordered by day using unix timestamp*/
drop table if exists nama.lausanne_trip;

create table if not exists nama.lausanne_trip
as
select betriebstag as day, upper(produkt_id) as type_of_transport,count(produkt_id) as number_of_trips from nama.sbb
where produkt_id <> '' and produkt_id <> 'PRODUKT_ID' AND faellt_aus_tf <> 'true' and ankunftszeit == '' group by betriebstag, upper(produkt_id) order by unix_timestamp(betriebstag, 'dd.MM.yyyy');

select day, type_of_transport, number_of_trips   from nama.lausanne_trip

%jdbc(hive)
/*trips with transport types and its avarages per day*/

select day, ls.type_of_transport as type_of_transport, number_of_trips, av.avarage_number_of_trips as avarage_number_of_trips  from nama.lausanne_trip as ls left join nama.av_nums as av on ls.type_of_transport = av.type_of_transport;

%jdbc(hive)
/*trips with transport types and its avarages on 17.10.2017*/

select day, ls.type_of_transport as type_of_transport, number_of_trips, av.avarage_number_of_trips as avarage_number_of_trips  from nama.lausanne_trip as ls left join nama.av_nums as av on ls.type_of_transport = av.type_of_transport where day == '17.10.2017';

%jdbc(hive)
/*number of stops on lausanne for train types with dates */
select betriebstag as day, verkehrsmittel_text as train_type ,count(*) as number_of_stop from nama.sbb where haltestellen_name == 'Lausanne' AND produkt_id == 'Zug' group by betriebstag, verkehrsmittel_text order by unix_timestamp(betriebstag, 'dd.MM.yyyy');

%jdbc(hive)
/*total number of stops on lausanne for all types of train */

select betriebstag as day , count(*) as total_number_of_stop from nama.sbb where haltestellen_name == 'Lausanne' AND produkt_id == 'Zug' group by betriebstag order by total_number_of_stop desc;

%jdbc(hive)
/*ranking of trains according to number of stops */

select verkehrsmittel_text as train_type ,count(*) as number_of_stop from nama.sbb where haltestellen_name == 'Lausanne' AND produkt_id == 'Zug' group by verkehrsmittel_text order by number_of_stop Desc;

%jdbc(hive)
/*ic trains on typical weekdays departing from geneva unioun with passing from lausanne*/

select * from nama.sbb where produkt_id <> '' and produkt_id == 'Zug' and produkt_id <> 'PRODUKT_ID' and faellt_aus_tf <> 'true' and verkehrsmittel_text == 'IC' and from_unixtime(unix_timestamp(betriebstag, 'dd.MM.yyyy'), 'u')<6 and (haltestellen_name == 'Lausanne' or (haltestellen_name == 'Genève')) limit 100;

%jdbc(hive)
/*no national holiday has been observed during the interval*/
/*ic trains on typical weekdays departing from geneva union with passing from lausanne*/
drop table if exists nama.valid_ic_journays;
drop table if exists nama.geneva_ic_journays;
drop table if exists nama.lausanne_ic_journays;
drop table if exists nama.geneve_lausanne_ic_journays;


create table if not exists nama.valid_ic_journays
as select * from nama.sbb where produkt_id <> '' and produkt_id == 'Zug' and produkt_id <> 'PRODUKT_ID' and faellt_aus_tf <> 'true' and verkehrsmittel_text == 'IC' and from_unixtime(unix_timestamp(betriebstag, 'dd.MM.yyyy'), 'u')<6;

create table if not exists nama.geneva_ic_journays
as 
select * from nama.valid_ic_journays where haltestellen_name == 'Genève';

create table if not exists nama.lausanne_ic_journays
as
select * from nama.valid_ic_journays where haltestellen_name == 'Lausanne';

CREATE TABLE if not exists nama.geneve_lausanne_ic_journays
as
select gv.linien_id as train_number, gv.betriebstag as departure_date, gv.abfahrtszeit as departure_time, ls.betriebstag as arrival_date, ls.ankunftszeit as arrival_time from nama.geneva_ic_journays as gv inner join nama.lausanne_ic_journays as ls on gv.linien_id = ls.linien_id 
    where unix_timestamp(ls.ankunftszeit, 'dd.MM.yyyy HH:mm')>unix_timestamp(gv.abfahrtszeit, 'dd.MM.yyyy HH:mm') and gv.betriebstag == ls.betriebstag;

select train_number, departure_time, arrival_time  from nama.geneve_lausanne_ic_journays limit 100;

%jdbc(hive)
/*normalizing table for first part because some of dates does not include second place in time*/
drop table if exists nama.ic_lausanne_measured_time;

create table if not exists nama.ic_lausanne_measured_time
as
select linien_id, IF(LENGTH(ankunftszeit)<17 and LENGTH(ankunftszeit)>0, CONCAT(ankunftszeit, ':00'), ankunftszeit) as arrival_time, IF(LENGTH(an_prognose)<17 and LENGTH(an_prognose)>0, CONCAT(an_prognose, ':00'), an_prognose) as real_arrival_time, IF(LENGTH(abfahrtszeit)<17 and LENGTH(abfahrtszeit)>0, CONCAT(abfahrtszeit, ':00'), abfahrtszeit) as departure_time, IF(LENGTH(ab_prognose)<17 and LENGTH(ab_prognose)>0, CONCAT(ab_prognose, ':00'), ab_prognose) as real_departure_time, an_prognose_status, ab_prognose_status
from nama.sbb where produkt_id <> '' and produkt_id == 'Zug' and produkt_id <> 'PRODUKT_ID' and faellt_aus_tf <> 'true' and verkehrsmittel_text == 'IC' and haltestellen_name == 'Lausanne' and (an_prognose_status =='GESCHAETZT' or ab_prognose_status =='GESCHAETZT');

%jdbc(hive)
/*arrival delay of 711*/
drop table if exists nama.delay_ic_arrival;


create table if not exists nama.delay_ic_arrival
as
select linien_id, IF(unix_timestamp(arrival_time, 'dd.MM.yyyy HH:mm:ss')<unix_timestamp(real_arrival_time, 'dd.MM.yyyy HH:mm:ss'), (unix_timestamp(real_arrival_time, 'dd.MM.yyyy HH:mm:ss') - unix_timestamp(arrival_time, 'dd.MM.yyyy HH:mm:ss'))/60, 0.0 ) as delay from nama.ic_lausanne_measured_time where (an_prognose_status =='GESCHAETZT');

select
count(CASE WHEN delay>0.0 AND delay < 1.0 THEN 1 END) AS group1,
count(CASE WHEN delay>=1.0 AND delay < 2.0 THEN 1 END) AS group2,
count(CASE WHEN delay>=2.0 AND delay < 3.0 THEN 1 END) AS group3,
count(CASE WHEN delay>=3.0 AND delay < 4.0 THEN 1 END) AS group4,
count(CASE WHEN delay>=4.0 AND delay < 5.0 THEN 1 END) AS group5,
count(CASE WHEN delay>=5.0 THEN 1 END) AS group6  from nama.delay_ic_arrival where linien_id == '711';

%jdbc(hive)
/*delay of deparure for 711*/
drop table if exists nama.delay_ic_departure;


create table if not exists nama.delay_ic_departure
as
select linien_id, IF(unix_timestamp(departure_time, 'dd.MM.yyyy HH:mm:ss')<unix_timestamp(real_departure_time, 'dd.MM.yyyy HH:mm:ss'), (unix_timestamp(real_departure_time, 'dd.MM.yyyy HH:mm:ss') - unix_timestamp(departure_time, 'dd.MM.yyyy HH:mm:ss'))/60, 0.0 ) as delay from nama.ic_lausanne_measured_time where (ab_prognose_status =='GESCHAETZT');


select
count(CASE WHEN delay>0.0 AND delay < 1.0 THEN 1 END) AS group1,
count(CASE WHEN delay>=1.0 AND delay < 2.0 THEN 1 END) AS group2,
count(CASE WHEN delay>=2.0 AND delay < 3.0 THEN 1 END) AS group3,
count(CASE WHEN delay>=3.0 AND delay < 4.0 THEN 1 END) AS group4,
count(CASE WHEN delay>=4.0 AND delay < 5.0 THEN 1 END) AS group5,
count(CASE WHEN delay>=5.0 THEN 1 END) AS group6  from nama.delay_ic_departure where linien_id == '711';

%jdbc(hive)
/*normalizing table for second part some of dates does not include second place in time*/
drop table if exists nama.ic_geneva_measured_time;

create table if not exists nama.ic_geneva_measured_time
as
select linien_id, IF(LENGTH(ankunftszeit)<17 and LENGTH(ankunftszeit)>0, CONCAT(ankunftszeit, ':00'), ankunftszeit) as arrival_time, IF(LENGTH(an_prognose)<17 and LENGTH(an_prognose)>0, CONCAT(an_prognose, ':00'), an_prognose) as real_arrival_time, IF(LENGTH(abfahrtszeit)<17 and LENGTH(abfahrtszeit)>0, CONCAT(abfahrtszeit, ':00'), abfahrtszeit) as departure_time, IF(LENGTH(ab_prognose)<17 and LENGTH(ab_prognose)>0, CONCAT(ab_prognose, ':00'), ab_prognose) as real_departure_time, an_prognose_status, ab_prognose_status
from nama.sbb where produkt_id <> '' and produkt_id == 'Zug' and produkt_id <> 'PRODUKT_ID' and faellt_aus_tf <> 'true' and verkehrsmittel_text == 'IC' and haltestellen_name == 'Genève' and (an_prognose_status =='GESCHAETZT' or ab_prognose_status =='GESCHAETZT');

%jdbc(hive)
/*arrival delay of geneva*/
drop table if exists nama.geneva_delay_ic_arrival;


create table if not exists nama.geneva_delay_ic_arrival
as
select linien_id, IF(unix_timestamp(arrival_time, 'dd.MM.yyyy HH:mm:ss')<unix_timestamp(real_arrival_time, 'dd.MM.yyyy HH:mm:ss'), (unix_timestamp(real_arrival_time, 'dd.MM.yyyy HH:mm:ss') - unix_timestamp(arrival_time, 'dd.MM.yyyy HH:mm:ss'))/60, 0.0 ) as delay from nama.ic_geneva_measured_time where (an_prognose_status =='GESCHAETZT');

%jdbc(hive)
/*departure delay of geneva*/
drop table if exists nama.geneva_delay_ic_departure;


create table if not exists nama.geneva_delay_ic_departure
as
select linien_id, IF(unix_timestamp(departure_time, 'dd.MM.yyyy HH:mm:ss')<unix_timestamp(real_departure_time, 'dd.MM.yyyy HH:mm:ss'), (unix_timestamp(real_departure_time, 'dd.MM.yyyy HH:mm:ss') - unix_timestamp(departure_time, 'dd.MM.yyyy HH:mm:ss'))/60, 0.0 ) as delay from nama.ic_geneva_measured_time where (ab_prognose_status =='GESCHAETZT');

%jdbc(hive)
/*percentiles of arrival delays of given trains*/
select linien_id, percentile_approx(delay, 0.5) as percentile_50, percentile_approx(delay, 0.75) as percentile_75 from nama.geneva_delay_ic_arrival WHERE linien_id in (702, 704, 706, 708, 710, 712, 714, 716, 718, 720, 722, 724, 726, 728, 730) GROUP BY linien_id;

%jdbc(hive)
/*percentiles of departure delays of given trains*/

select linien_id, percentile_approx(delay, 0.5) as percentile_50, percentile_approx(delay, 0.75) as percentile_75 from nama.geneva_delay_ic_departure where linien_id in (702, 704, 706, 708, 710, 712, 714, 716, 718, 720, 722, 724, 726, 728, 730) group by linien_id;

