from <your_gaspar_name>.hashtags_example;

%jdbc(hive)
-- Here, we use a regular expression to remove the brackets and the double quotes from the strings reprensenting the list of tweets.
-- Once we have a clean column of hashtag, we split it by comma ',' to and perform the explode version to normalize the table
drop table if exists abouzaid.allhashtags;
create table if not exists abouzaid.allhashtags as
select timestamp_ms, lang, hashtag  from intermediate lateral view explode(split(regexp_replace(hashtags,'\\[\"|\"\\]|\"',''),',')) adTable as hashtag;

%jdbc(hive)
-- Here is an overview of the result
select * from abouzaid.allhashtags limit 50;

%jdbc(hive)
-- We represent the most represented languages in a pie chart as follows
select lang, count(*) as cnt from abouzaid.allhashtags group by lang order by cnt desc limit 10;

%jdbc(hive)
-- Here, we get the top 20 most mentioned hashtags, and display the results with the contribution of each language to the hashtags
select hashtag, lang, count(*) as cnt from abouzaid.allhashtags group by hashtag, lang order by cnt desc limit 20;

%jdbc(hive)
-- Here is an overview of our table
select * from abouzaid.allhash limit 50;

%jdbc(hive)
-- As done earlier, we use a regular expression to remove the brackets and the double quotes from the strings reprensenting the list of tweets.
-- Once we have a clean column of hashtag, we split it by comma ',' to and perform the explode version to normalize the table, the result
-- is stored in finalhashtags
drop table if exists abouzaid.finalhashtags;
create table if not exists abouzaid.finalhashtags as
select timestamp_ms, lang, hashtag from abouzaid.allhash lateral view explode(split(regexp_replace(hashtags,'\\[\"|\"\\]|\"',''),',')) adTable as hashtag;

select * from abouzaid.finalhashtags limit 50;

%jdbc(hive)
-- We represent the most represented hashtags in a pie chart as follows
